import './App.css';
import form from './form.js';

function App() {
  return (
    <div className="App">
    <form id="survey-form">
              <div class="form-group">
        <p>How would you rate this movie?</p>
        <label>
          <input name="user-recommend" type="radio" class="input-radio" checked />Awesome!</label>
        <label>
          <input name="user-recommend" type="radio" class="input-radio" />Good.</label>
        <label><input name="user-recommend" type="radio" class="input-radio" />Could be better...</label>
        <label><input name="user-recommend" type="radio" class="input-radio" />The WORST!</label>
      </div>
       <div class="form-group">
        <button type="submit" id="submit" class="submit-button">
          Submit
        </button>
      </div>
  </form>
    </div>
  );
}

export default App;
